import{_ as t,c as o,o as a,ag as s}from"./chunks/framework.Ds6Eueu6.js";const u=JSON.parse('{"title":"pg_restore","description":"","frontmatter":{},"headers":[],"relativePath":"docs/7x/utility_guide/ref/pg_restore.md","filePath":"docs/7x/utility_guide/ref/pg_restore.md"}'),n={name:"docs/7x/utility_guide/ref/pg_restore.md"};function i(r,e,d,c,p,l){return a(),o("div",null,e[0]||(e[0]=[s(`<h1 id="pg-restore" tabindex="-1">pg_restore <a class="header-anchor" href="#pg-restore" aria-label="Permalink to &quot;pg_restore&quot;">​</a></h1><p>Restores a database from an archive file created by <code>pg_dump</code>.</p><h2 id="synopsis" tabindex="-1"><a id="section2"></a>Synopsis <a class="header-anchor" href="#synopsis" aria-label="Permalink to &quot;&lt;a id=&quot;section2&quot;&gt;&lt;/a&gt;Synopsis&quot;">​</a></h2><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>pg_restore [&lt;connection-option&gt; ...] [&lt;restore_option&gt; ...] [&lt;filename&gt;]</span></span>
<span class="line"><span></span></span>
<span class="line"><span>pg_restore -? | --help</span></span>
<span class="line"><span></span></span>
<span class="line"><span>pg_restore -V | --version</span></span></code></pre></div><h2 id="description" tabindex="-1"><a id="section3"></a>Description <a class="header-anchor" href="#description" aria-label="Permalink to &quot;&lt;a id=&quot;section3&quot;&gt;&lt;/a&gt;Description&quot;">​</a></h2><p><code>pg_restore</code> is a utility for restoring a database from an archive created by <a href="./pg_dump.html">pg_dump</a> in one of the non-plain-text formats. It will issue the commands necessary to reconstruct the database to the state it was in at the time it was saved. The archive files also allow <code>pg_restore</code> to be selective about what is restored, or even to reorder the items prior to being restored.</p><p><code>pg_restore</code> can operate in two modes. If a database name is specified, the archive is restored directly into the database. Otherwise, a script containing the SQL commands necessary to rebuild the database is created and written to a file or standard output. The script output is equivalent to the plain text output format of <code>pg_dump</code>. Some of the options controlling the output are therefore analogous to <code>pg_dump</code> options.</p><p><code>pg_restore</code> cannot restore information that is not present in the archive file. For instance, if the archive was made using the &quot;dump data as <code>INSERT</code> commands&quot; option, <code>pg_restore</code> will not be able to load the data using <code>COPY</code> statements.</p><h2 id="options" tabindex="-1"><a id="section4"></a>Options <a class="header-anchor" href="#options" aria-label="Permalink to &quot;&lt;a id=&quot;section4&quot;&gt;&lt;/a&gt;Options&quot;">​</a></h2><p>filename : Specifies the location of the archive file (or directory, for a directory-format archive) to be restored. If not specified, the standard input is used.</p><p><strong>Restore Options</strong></p><p>-a | --data-only : Restore only the data, not the schema (data definitions). Table data and sequence values are restored, if present in the archive.</p><pre><code>This option is similar to, but for historical reasons not identical to, specifying \`--section=data\`.
</code></pre><p>-c | --clean : Clean (drop) database objects before recreating them. (If you do not also specify <code>--if-exists</code>, this may generate some harmless error messages if any objects were not present in the destination database.)</p><p>-C | --create : Create the database before restoring into it. If <code>--clean</code> is also specified, drop and recreate the target database before connecting to it.</p><p>: With <code>--create</code>, <code>pg_restore</code> also restores the database&#39;s comment if any, and any configuration variable settings that are specific to this database, that is, any <code>ALTER DATABASE ... SET ...</code> and <code>ALTER ROLE ... IN DATABASE ... SET ...</code> commands that mention this database. Access privileges for the database itself are also restored, unless <code>--no-acl</code> is specified.</p><p>: When this option is used, the database named with <code>-d</code> is used only to issue the initial <code>DROP DATABASE</code> and <code>CREATE DATABASE</code> commands. All data is restored into the database name that appears in the archive.</p><p>-d dbname | --dbname=dbname : Connect to this database and restore directly into this database. The dbname can be a <a href="https://www.postgresql.org/docs/12/libpq-connect.html#LIBPQ-CONNSTRING" target="_blank" rel="noreferrer">Connection Strings</a>. If so, connection string parameters override any conflicting command line options.</p><p>-e | --exit-on-error : Exit if an error is encountered while sending SQL commands to the database. The default is to continue and to display a count of errors at the end of the restoration.</p><p>-f outfilename | --file=outfilename : Specify output file for generated script, or for the listing when used with <code>-l</code>. Use <code>-</code> for <code>stdout</code>.</p><p>-F c|d|t | --format={custom | directory | tar} : The format of the archive produced by <a href="./pg_dump.html">pg_dump</a>. It is not necessary to specify the format, since <code>pg_restore</code> will determine the format automatically. Format can be <code>custom</code>, <code>directory</code>, or <code>tar</code>.</p><p>-I index | --index=index : Restore definition of named index only. You can specify multiple indexes with multiple <code>-I</code> switches.</p><p>-j | --number-of-jobs | --jobs=number-of-jobs : Run the most time-consuming parts of <code>pg_restore</code> — those which load data, create indexes, or create constraints — using multiple concurrent jobs. This option can dramatically reduce the time to restore a large database to a server running on a multiprocessor machine. This option is ignored when emitting a script rather than connecting directly to a database server.</p><p>: Each job is one process or one thread, depending on the operating system, and uses a separate connection to the server.</p><p>: The optimal value for this option depends on the hardware setup of the server, of the client, and of the network. Factors include the number of CPU cores and the disk setup. A good place to start is the number of CPU cores on the server, but values larger than that can also lead to faster restore times in many cases. Of course, values that are too high will lead to decreased performance because of thrashing.</p><p>: Only the custom and directory archive formats ase supported with this option. The input file must be a regular file or directory (not, for example, a pipe or standard input). Also, multiple jobs cannot be used together with the option <code>--single-transaction</code>.</p><p>-l | --list : List the table contents of the archive. The output of this operation can be used as input to the <code>-L</code> option. Note that if filtering switches such as <code>-n</code> or <code>-t</code> are used with <code>-l</code>, they restrict the items listed.</p><p>-L list-file | --use-list=list-file : Restore only those archive elements that are listed in list-file, and restore them in the order they appear in the file. Note that if filtering switches such as <code>-n</code> or <code>-t</code> are used with <code>-L</code>, they further restrict the items restored.</p><p>: list-file is normally created by editing the output of a previous <code>-l</code> operation. Lines can be moved or removed, and can also be commented out by placing a semicolon (<code>;</code>) at the start of the line. See below for examples.</p><p>-n schema | --schema=schema : Restore only objects that are in the named schema. You can specify multiple schemas with multiple <code>-n</code> switches. Combine with the <code>-t</code> option to restore just a specific table.</p><p>-N schema | --exclude-schema=schema : Do not restore objects that are in the named schema. You can specify multiple schemas to exclude with multiple <code>-N</code> switches.</p><p>: When both <code>-n</code> and <code>-N</code> are specified for the same schema name, the <code>-N</code> switch takes precedence and the schema is excluded.</p><p>-O | --no-owner : Do not output commands to set ownership of objects to match the original database. By default, <code>pg_restore</code> issues <code>ALTER OWNER</code> or <code>SET SESSION AUTHORIZATION</code> statements to set ownership of created schema elements. These statements will fail unless the initial connection to the database is made by a superuser (or the same user that owns all of the objects in the script). With <code>-O</code>, any user name can be used for the initial connection, and this user will own all the created objects.</p><p>-P function-name(argtype [, ...]) | --function=function-name(argtype [, ...]) : Restore the named function only. The function name must be enclosed in quotes. Be careful to spell the function name and arguments exactly as they appear in the dump file&#39;s table of contents (as shown by the <code>--list</code> option). You can specify multiple functions with multiple <code>-P</code> switches.</p><p>-s | --schema-only : Restore only the schema (data definitions), not data, to the extent that schema entries are present in the archive.</p><p>: This option is the inverse of <code>--data-only</code>. It is similar to, but for historical reasons not identical to, specifying <code>--section=pre-data --section=post-data</code>.</p><p>: (Do not confuse this with the <code>--schema</code> option, which uses the word <em>schema</em> in a different meaning.)</p><p>-S username | --superuser=username : Specify the superuser user name to use when deactivating triggers. This is only relevant if <code>--disable-triggers</code> is used.</p><pre><code>&gt; **Note** WarehousePG does not support user-defined triggers.
</code></pre><p>-t table | --table=table : Restore definition and/or data of the named table only. &quot;table&quot; includes views, materialized views, sequences, and foreign tables. You can specify multiple tables with multiple <code>-t</code> switches. Combine this option with the <code>-n</code> option to specify table(s) in a particular schema. : When you specify <code>-t</code>, <code>pg_restore</code> makes no attempt to restore any other database objects that the selected table(s) might depend upon. Therefore, there is no guarantee that a specific-table restore into a clean database will succeed. : This option does not behave identically to the <code>-t</code> option of <code>pg_dump</code>. <code>pg_restore</code> does not currently support wild-card matching, nor can you include a schema name within its <code>-t</code>. And, while <code>pg_dump</code>&#39;s <code>-t</code> flag will also dump subsidiary objects (such as indexes) of the selected table(s), <code>pg_restore</code>&#39;s <code>-t</code> flag does not include such subsidiary objects.</p><pre><code>&gt; **Note** In versions prior to WarehousePG 7, this flag matched only tables, not any other type of relation.
</code></pre><p>-T trigger | --trigger=trigger : Restore named trigger only.</p><pre><code>&gt; **Note** WarehousePG does not support user-defined triggers.
</code></pre><p>-v | --verbose : Specifies verbose mode.</p><p>-V | --version : Print the <code>pg_restore</code> version and exit.</p><p>-x | --no-privileges | --no-acl : Prevent restoration of access privileges (<code>GRANT/REVOKE</code> commands).</p><p>-1 | --single-transaction : Run the restore as a single transaction (that is, wrap the emitted commands in <code>BEGIN</code>/<code>COMMIT1). This ensures that either all of the commands complete successfully, or no changes are applied. This option implies </code>--exit-on-error\`.</p><p>--disable-triggers : This option is relevant only when performing a data-only restore. It instructs <code>pg_restore</code> to run commands to temporarily deactivate triggers on the target tables while the data is reloaded. Use this if you have triggers on the tables that you do not want to invoke during data reload. The commands emitted for <code>--disable-triggers</code> must be invoked as superuser. So you should also specify a superuser name with <code>-S</code> or, preferably, run <code>pg_restore</code> as a superuser.</p><pre><code>&gt; **Note** WarehousePG does not support user-defined triggers.
</code></pre><p>--enable-row-security : This option is relevant only when restoring the contents of a table which has row security. By default, <code>pg_restore</code> sets <code>row_security</code> to off, to ensure that all data is restored in to the table. If the user does not have sufficient privileges to bypass row security, then an error is thrown. This parameter instructs <code>pg_restore</code> to set <code>row_security</code> to on instead, allowing the user to attempt to restore the contents of the table with row security enabled. This might still fail if the user does not have the right to insert the rows from the dump into the table.</p><p>: This option currently also requires the dump be in <code>INSERT</code> format, as <code>COPY FROM</code> does not support row security.</p><p>--if-exists : Use conditional commands (for example, add an <code>IF EXISTS</code> clause) to drop database objects. This option is not valid unless <code>--clean</code> is also specified.</p><p>--no-comments : Do not output commands to restore comments, even if the archive contains them.</p><p>--no-data-for-failed-tables : By default, table data is restored even if the creation command for the table failed (for example, because it already exists). With this option, data for such a table is skipped. This behavior is useful when the target database may already contain the desired table contents. Specifying this option prevents duplicate or obsolete data from being loaded. This option is effective only when restoring directly into a database, not when producing SQL script output.</p><p>--no-security-labels : Do not output commands to restore security labels, even if the archive contains them.</p><p>--no-tablespaces : Do not output commands to select tablespaces. With this option, all objects will be created in whichever tablespace is the default during restore.</p><p>--section=sectionname : Only restore the named section. The section name can be <code>pre-data</code>, <code>data</code>, or <code>post-data</code>. This option can be specified more than once to select multiple sections. : The data section contains actual table data. Post-data items consist of definitions of indexes, triggers, rules, and constraints other than validated check constraints. Pre-data items consist of all other data definition items. : The default is to restore all sections.</p><p>--strict-names : Require that each schema (<code>-n</code>/<code>--schema</code>) and table (<code>-t</code>/<code>--table</code>) qualifier match at least one schema/table in the backup file.</p><p>--use-set-session-authorization : Output SQL-standard <code>SET SESSION AUTHORIZATION</code> commands instead of <code>ALTER OWNER</code> commands to determine object ownership. This makes the dump more standards-compatible, but depending on the history of the objects in the dump, it might not restore properly.</p><p>-? | --help : Show help about <code>pg_restore</code> command line arguments, and exit.</p><p><strong>Connection Options</strong></p><p>-h host | --host host : The host name of the machine on which the WarehousePG coordinator database server is running. If not specified, reads from the environment variable <code>PGHOST</code> or defaults to <code>localhost</code>.</p><p>-p port | --port port : The TCP port on which the WarehousePG coordinator database server is listening for connections. If not specified, reads from the environment variable <code>PGPORT</code> or defaults to <code>5432</code>.</p><p>-U username | --username username : The database role name to connect as. If not specified, reads from the environment variable <code>PGUSER</code> or defaults to the current system role name.</p><p>-w | --no-password : Never issue a password prompt. If the server requires password authentication and a password is not available by other means such as a <code>.pgpass</code> file the connection attempt will fail. This option can be useful in batch jobs and scripts where no user is present to enter a password.</p><p>-W | --password : Force a password prompt.</p><p>: This option is never required, since <code>pg_restore</code> automatically prompts for a password if the server demands password authentication. However, <code>pg_restore</code> will waste a connection attempt determinig that the server wants a password. In some cases it is worth typing <code>-W</code> to avoid the extra connection attempt.</p><p>--role=rolename : Specifies a role name to be used to perform the restore. This option causes <code>pg_restore</code> to issue a <code>SET ROLE &lt;rolename&gt;</code> command after connecting to the database. It is useful when the authenticated user (specified by <code>-U</code>) lacks privileges needed by <code>pg_restore</code>, but can switch to a role with the required rights. Some installations have a policy against logging in directly as a superuser, and use of this option allows restores to be performed without violating the policy.</p><h2 id="environment" tabindex="-1"><a id="section5"></a>Environment <a class="header-anchor" href="#environment" aria-label="Permalink to &quot;&lt;a id=&quot;section5&quot;&gt;&lt;/a&gt;Environment&quot;">​</a></h2><p>PGHOST PGOPTIONS PGPORT PGUSER : Default connection parameters.</p><p>PG_COLOR : Specifies whether to use color in diagnostic messages. Possible values are <code>always</code>, <code>auto</code>, and <code>never</code>.</p><p>This utility also uses the <a href="https://www.postgresql.org/docs/12/libpq-envars.html" target="_blank" rel="noreferrer">environment variables supported by libpq</a>.</p><h2 id="diagnostics" tabindex="-1"><a id="diagnostics"></a>Diagnostics <a class="header-anchor" href="#diagnostics" aria-label="Permalink to &quot;&lt;a id=&quot;diagnostics&quot;&gt;&lt;/a&gt;Diagnostics&quot;">​</a></h2><p>When you specify a direct database connection using the <code>-d</code> option, <code>pg_restore</code> internally executes SQL statements. If you have problems running <code>pg_restore</code>, make sure you are able to select information from the database using, for example, <code>psql</code>. Also, any default connection settings and environment variables used by the <code>libpq</code> front-end library will apply.</p><h2 id="notes" tabindex="-1"><a id="section6"></a>Notes <a class="header-anchor" href="#notes" aria-label="Permalink to &quot;&lt;a id=&quot;section6&quot;&gt;&lt;/a&gt;Notes&quot;">​</a></h2><p>If your installation has any local additions to the <code>template1</code> database, be careful to load the output of <code>pg_restore</code> into a truly empty database; otherwise you are likely to get errors due to duplicate definitions of the added objects. To make an empty database without any local additions, copy from <code>template0</code> not <code>template1</code>, for example:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>CREATE DATABASE foo WITH TEMPLATE template0;</span></span></code></pre></div><p>When restoring data to a pre-existing table and the option <code>--disable-triggers</code> is used, <code>pg_restore</code> emits commands to deactivate triggers on user tables before inserting the data, then emits commands to re-enable them after the data has been inserted. If the restore is stopped in the middle, the system catalogs may be left in the wrong state.</p><p>See also the <a href="./pg_dump.html">pg_dump</a> documentation for details on limitations of <code>pg_dump</code>.</p><p>Once restored, it is wise to run <code>ANALYZE</code> on each restored table so the query planner has useful statistics.</p><h2 id="examples" tabindex="-1"><a id="section7"></a>Examples <a class="header-anchor" href="#examples" aria-label="Permalink to &quot;&lt;a id=&quot;section7&quot;&gt;&lt;/a&gt;Examples&quot;">​</a></h2><p>Assume we have dumped a database called <code>mydb</code> into a custom-format dump file:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>pg_dump -Fc mydb &gt; db.dump</span></span></code></pre></div><p>To drop the database and recreate it from the dump:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>dropdb mydb</span></span>
<span class="line"><span>pg_restore -C -d template1 db.dump</span></span></code></pre></div><p>Run the following commands to reload the dump into a new database called <code>newdb</code>. Notice there is no <code>-C</code> option provided. Instead, connect directly to the database to which to restore to. Also note that the new database is cloned from <code>template0</code> not <code>template1</code>, to ensure that it is initially empty:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>createdb -T template0 newdb</span></span>
<span class="line"><span>pg_restore -d newdb db.dump</span></span></code></pre></div><p>To reorder database items, you must first dump the table of contents of the archive:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>pg_restore -l db.dump &gt; db.list</span></span></code></pre></div><p>The listing file consists of a header and one line for each item, for example,</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>; Archive created at Mon Sep 14 13:55:39 2019</span></span>
<span class="line"><span>;     dbname: DBDEMOS</span></span>
<span class="line"><span>;     TOC Entries: 81</span></span>
<span class="line"><span>;     Compression: 9</span></span>
<span class="line"><span>;     Dump Version: 1.10-0</span></span>
<span class="line"><span>;     Format: CUSTOM</span></span>
<span class="line"><span>;     Integer: 4 bytes</span></span>
<span class="line"><span>;     Offset: 8 bytes</span></span>
<span class="line"><span>;     Dumped from database version: 9.4.24</span></span>
<span class="line"><span>;     Dumped by pg_dump version: 9.4.24</span></span>
<span class="line"><span>;</span></span>
<span class="line"><span>; Selected TOC Entries:</span></span>
<span class="line"><span>;</span></span>
<span class="line"><span>3; 2615 2200 SCHEMA - public pasha</span></span>
<span class="line"><span>1861; 0 0 COMMENT - SCHEMA public pasha</span></span>
<span class="line"><span>1862; 0 0 ACL - public pasha</span></span>
<span class="line"><span>317; 1247 17715 TYPE public composite pasha</span></span>
<span class="line"><span>319; 1247 25899 DOMAIN public domain0 pasha2</span></span></code></pre></div><p>Semicolons start a comment, and the numbers at the start of lines refer to the internal archive ID assigned to each item. You can comment out, delete, and reorder lines in the file. For example:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>10; 145433 TABLE map_resolutions postgres</span></span>
<span class="line"><span>;2; 145344 TABLE species postgres</span></span>
<span class="line"><span>;4; 145359 TABLE nt_header postgres</span></span>
<span class="line"><span>6; 145402 TABLE species_records postgres</span></span>
<span class="line"><span>;8; 145416 TABLE ss_old postgres</span></span></code></pre></div><p>You can use this file as input to <code>pg_restore</code>, to restore only items 10 and 6, in that order:</p><div class="language- vp-adaptive-theme"><button title="Copy Code" class="copy"></button><span class="lang"></span><pre class="shiki shiki-themes github-light github-dark vp-code" tabindex="0"><code><span class="line"><span>pg_restore -L db.list db.dump</span></span></code></pre></div><h2 id="see-also" tabindex="-1"><a id="section8"></a>See Also <a class="header-anchor" href="#see-also" aria-label="Permalink to &quot;&lt;a id=&quot;section8&quot;&gt;&lt;/a&gt;See Also&quot;">​</a></h2><p><a href="./pg_dump.html">pg_dump</a>, <a href="./pg_dumpall.html">pg_dumpall</a>, <a href="./psql.html">psql</a></p>`,97)]))}const m=t(n,[["render",i]]);export{u as __pageData,m as default};
